import React from "react";

export default function TodoForm({ todos, onEdit}){
    return(
        <div className="todo-form">
            {props.todos.map( todo => (
                <div key={props.todos.id} onClick={() => props.onEdit(todo.id)}>
                    {props.todo.body}
                </div>
            ))}

        </div>
    )
}
